import s from './Messages.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = '/messages/' + props.id;
    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.message}</div>
    )
}

const Dialogs = (props) => {

    let DialogsData = [ {id: 'david', name: 'David Bowie'},
                        {id: 'queen', name: 'Group Queen'},
                        {id: 'kenye', name: 'Kanye West'}]

    let MessagesData = [{id: 1, message: 'Pressure pushing down on me'},
                        {id: 2, message:'Pressing down on you, no man ask for'},
                        {id: 3, message:'Um ba ba be'}]
}


const Messages = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItem name={DialogData[0].name} id={DialogData[0].id}/>
                <DialogItem name={DialogData[1].name} id={DialogData[1].id}/>
                <DialogItem name={DialogData[2].name} id={DialogData[2].id}/>
            </div>


            <div className={s.messages}>
                <Message message='Pressure pushing down on me'/>
                <Message message='Pressing down on you, no man ask for'/>
                <Message message='Um ba ba be'/>
            </div>
        </div>
    )
}

export default Messages;
